const getPlanetsStarWars = async () => {
  const response = await fetch('https://swapi-trybe.herokuapp.com/api/planets/');
  try {
    const data = await response.json();
    return data;
  } catch (error) {
    return error.message;
  }
};

export default getPlanetsStarWars;
